import React, { Component } from 'react'

export class ActiveUser extends Component {
    render() {
        return (
            <div>
                <div id="current-user-label">Active User</div>
        <div className="current-user">{`${this.props.activeUser.firstName} ${this.props.activeUser.lastName}`}</div>
            </div>
        )
    }
}

export default ActiveUser
